import './App.css';

function App() {
  const a=2;
  const b=3;
  return (
    <div className="App">
        <h1>titulo de la app</h1>
        <strong>estamos trabajando en ello</strong>
        <div>
          <p>el resultado es</p><br></br>
          {a+b}
        </div>
    </div>
  );
}

export default App;
